import Link from 'next/link';

const Header = () => {
  return (
    <>
      <header>
        <nav>
          <ul style={linkStyle}>
            <li><Link href="/">Home</Link></li>
            <li><Link href="/about">About</Link></li>
            <li><Link href="/contact">Contact</Link></li>
          </ul>
        </nav>
      </header>

      <h2>NextJs Basic concepts</h2>
    </>
  );
};

const linkStyle = {
  display: 'flex',
  listStyle: 'none'
}

export default Header;
